import React from 'react';

function Profile(props) {
    return (
        <div className='profile-bodyContainer'>

            <div className='profile-container'>

                <button>Mudar dados</button>
                <button>Alterar foto</button>

            </div>
            
        </div>
    );
}

export default Profile;
